        <div class="containerInner ui-sortable">
            <div class="row bgCover  noBorder borderSolid border3px cornersAll radius0 shadow0 P0-top P0-bottom P0H noTopMargin" id="row--81553" data-trigger="none" data-animate="fade" data-delay="500" data-title="1 column row" style="padding-top: 20px; padding-bottom: 20px; margin: 0px; outline: none;">
                <div id="col-full-158" class="col-md-12 innerContent col_left" data-col="full" data-trigger="none" data-animate="fade" data-delay="500" data-title="1st column" style="outline: none;">
                    <div class="col-inner bgCover  noBorder borderSolid border3px cornersAll radius0 shadow0 P0-top P0-bottom P0H noTopMargin" style="padding: 0 10px">
                        <div class="de elHeadlineWrapper ui-droppable hiddenElementTools de-editable" id="tmp_paragraph-39742" data-de-type="headline" data-de-editing="false" data-title="Paragraph" data-ce="true" data-trigger="none" data-animate="fade" data-delay="500" style="margin-top: 0px; outline: none; cursor: pointer;" aria-disabled="false">
                            <div class="ne elHeadline hsSize1 lh5 elMargin0 elBGStyle0 hsTextShadow3 de1column" data-bold="inherit" style="text-align: center; color: rgb(255, 255, 255); font-size: 34px;" data-gramm="false">
                                Take a moment and consider, when is the last time you felt pleasure?
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Notice the way you feel when I say the word pleasure?
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    What comes up for you when you hear pleasure?
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Were you taught that pleasure is bad or good?
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Love and pleasure are a result of hormones produced in your brain and in your sex organs.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    When these hormones are activated, you can feel love and pleasure in your entire body.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    These hormones were designed to bond and connect you to others and they also help you love yourself.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Pleasure is a part of love.
                                </div>
                                <div>
                                    It’s a part of the experience of being human.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    But many of us have been taught that pleasure is wrong. This makes it feel wrong in our bodies and that is painful because it is not true. This causes negative associations with pleasure and we disassociate to avoid the pain. This causes numbness in all areas of our lives. When we don’t feel the pain, we don’t feel the pleasure and vice versa. It makes it hard to truly love.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Think back to being a teenage girl. Most of us went through periods of being “boy-crazy” or “girl-crazy” depending on our sexual orientation. That time of sexual awakening was most likely shut down by some well meaning adult.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Women in particular are warned to not be sexual. People could get the wrong idea. Boys will want to have sex with you, (god forbid). You’ll get a bad reputation. You could get pregnant. You could get STDs. Good girls don’t have sex outside of marriage and on and on and on.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    These delicious feelings of desire get dampened and then covered and shut down until someone comes along that ignites that flame inside of us. Along with that flame of desire, shame and guilt are also ignited. Our desire has been intertwined with wrongness.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    But then! We are supposed to find the person of our dreams and feel overwhelming desire for him or her at all times and have amazing sex and it’s all just supposed to happen. Our brains don’t work that way. Once two neurons starts firing together such as desire and shame, they keep firing together unless deconditioning is done and new connections are made.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    The Path of Pleasure begins with self-love. This connection to yourself is the starting point to moving through everything that is blocking you from love.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Our bodies are made up of a system of Pleasure Centers. Through Tantric Activation, these Pleasure Centers are activated and our senses are activated and we can feel pleasure and orgasm, throughout our entire bodies. <br>
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    The Pleasure Centers are also connected to areas of repression. The repression blocks the experience of love and pleasure. The Path of Pleasure was created to clear this repression and activate the pleasure centers in your body. During each step of the seven part journey, I will guide you to become conscious of what’s holding you back and to create pleasure in that area of your life.<br>
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Do you have one or more of these symptoms in your life?<br>
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Symptom number one:
                                </div>
                                <div>
                                    I don’t know who I am
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Have you ever had sex with someone because you felt like you were supposed to? Had sex to please someone else? Faked an orgasm to get them to finish and leave you alone? Have you had sex with no enjoyment, no pleasure? Have you felt abandoned and rejected when your satisfaction wasn’t a priority? Did your body desire more and then shut down because it knew it would never receive what it desired? This all causes disconnect in the Primal Pleasure Center.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Have you ever felt yourself desiring to feel secure in knowing that your body can orgasm? Have you desired to feel safe with a partner that values your pleasure? Have you wanted to be the one choosing when to have sex or when sex would finish? These are the outcomes of an activated Primal Pleasure Center.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Symptom number two:
                                </div>
                                <div>
                                    I don’t feel turned on
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Do you remember a time when you felt turned on regularly? Think back to your teenage years. Did you have crushes and desire them? Over the years, has your turn on and desire subsided or shut down completely? Do you avoid intimacy with others? The Sexual Pleasure Center is the area of our sexual desire. This area is meant to be fluid and watery but sometimes it feels dry. And this hurts. Creativity in all areas of life gets shut down.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Have you wished that you could feel passion again? Do you want to feel turned on by your lover? Do you want to get wet when you think about sex? When the Sexual Pleasure Center is activated, passion, turn on and wetness are all felt in this area of the body.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Symptom number three:
                                </div>
                                <div>
                                    I’m too tired for sex
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
                                    Have you ever had the desire for sex but not the energy for sex? Has it been hard to have sex for long periods of time without getting tired? Do feelings of sadness, loneliness or despair shut down your desire for sex? The Power Pleasure Center is the area of strength and stamina.
                                </div>
                                <div>
                                    <br>
                                </div>
                                <div>
